const AddUser = () => {
  return (
    <form>
      <labe htmlfor="InputName"> Name</labe>
      <input id="InputName" type="text" />
      <labe htmlfor="InputAge"> Age</labe>
      <input id="InputAge" type="number" />
      <butto>Add user</butto>
    </form>
  );
};

export default AddUser;
